Fake MongoDB collection with FakeItEasy in C#<p>I'm trying to write unit tests for my .NET Core API's service layer with NUnit and FakeItEasy and I have troubles with faking the connection to Mongo. The service is from the <a href="https://learn.microsoft.com/en-us/aspnet/core/tutorials/first-mongo-app?view=aspnetcore-6.0&amp;tabs=visual-studio" rel="nofollow noreferrer">Microsoft documentation</a> with small changes.</p>
<p>Here is my code:</p>
<p><em>IBaseService.cs</em></p>
<pre><code>public interface IBaseService&lt;T&gt;
{
    public IMongoClient MongoClient { get; }
    public IMongoDatabase MongoDb { get; }
    public IMongoCollection&lt;T&gt; GetCollection();
}
</code></pre>
<p><em>IBoxService.cs</em> defines some functions</p>
<pre><code>public interface IBoxService : IBaseService&lt;Box&gt;
</code></pre>
<p><em>BoxService.cs</em></p>
<pre><code>public class BoxService : IBoxService
{
    private readonly IOptions&lt;DbSettings&gt; _dbSettings;
    private readonly IMongoCollection&lt;Box&gt; _boxCollection;

    public BoxService(IOptions&lt;DbSettings&gt; dbSettings)
    {
        _dbSettings = dbSettings;
        MongoClient = new MongoClient(_dbSettings.Value.ConnectionString);

        MongoDb = MongoClient.GetDatabase(_dbSettings.Value.DatabaseName);

        _boxCollection = GetCollection();
    }

    public IMongoClient MongoClient { get; }
    public IMongoDatabase MongoDb { get; }
    public IMongoCollection&lt;Box&gt; GetCollection()
    {
        return MongoDb.GetCollection&lt;Box&gt;(_dbSettings.Value.BoxCollectionName);
    }

    public async Task&lt;List&lt;Box&gt;&gt; FindAllAsync() =&gt;
        await _boxCollection.Find(_ =&gt; true).ToListAsync();
}
</code></pre>
<p><em>DbSettings.cs</em></p>
<pre><code>public class DbSettings
{
    public string ConnectionString { get; set; } = null!;
    public string DatabaseName { get; set; } = null!;
    public string BoxCollectionName { get; set; } = null!;
}
</code></pre>
<p>And finally the <em>BoxServiceTest.cs</em></p>
<pre><code>public class BoxServiceTest
{
    private readonly IOptions&lt;DbSettings&gt; _fakeOptions;
    private readonly IMongoClient _mongoClient;
    private readonly IMongoDatabase _mongoDb;
    private readonly IMongoCollection&lt;Box&gt; _boxCollection;
    private readonly List&lt;Box&gt; _boxes;

    public BoxServiceTest()
    {
        _boxCollection = A.Fake&lt;IMongoCollection&lt;Box&gt;&gt;();
        _fakeOptions = A.Fake&lt;IOptions&lt;DbSettings&gt;&gt;();
        _mongoClient = A.Fake&lt;MongoClient&gt;();
        _mongoDb = A.Fake&lt;IMongoDatabase&gt;();

        _boxes = new List&lt;Box&gt; {...};
    }

    [Test]
    public async Task FindAllAsync_ReturnsAllBoxes()
    {
        // Arrange
        var dbSettings = new DbSettings
        {
            ConnectionString = &quot;mongodb://localhost:27017&quot;,
            DatabaseName = &quot;database&quot;,
            BoxCollectionName = &quot;boxes&quot;
        };
        A.CallTo(() =&gt; _fakeOptions.Value).Returns(dbSettings);

        var boxService = new BoxService(_fakeOptions);

        // Act
        var boxes = await boxService.FindAllAsync();

        // Assert
    }
}
</code></pre>
<p>Here the boxes contains the records from Mongo but I'd like it to have the values from the _boxes list instead of querying the db for every test.</p>
<p>I've tried faking some calls but without any success. Trying to fake the GetDatabase call:</p>
<pre><code>A.CallTo(() =&gt; _mongoClient.GetDatabase(A&lt;string&gt;._, default)).Returns(_mongoDb);
</code></pre>
<p>But it gives an error:</p>
<blockquote>
<p>The current proxy generator can not intercept the method MongoDB.Driver.IMongoClient.GetDatabase(System.String name, MongoDB.Driver.MongoDatabaseSettings settings) for the following reason:
- Non-virtual members can not be intercepted. Only interface members and virtual, overriding, and abstract members can be intercepted.</p>
</blockquote>
<p>What am I doing wrong? How should I fake the Mongo connection and the returned list?</p>

