Node JS mongoose insert data at the beginning<p>I'm experimenting with mongodb using mongoose in NodeJS.
I have a simple web where a user can create a post.
On creation this post is saved to mongodb.</p>
<p>On the web, i have a scroll event listener which checks if the user is on the bottom of the page or not. If he is on the bottom, it will do a fetch to the backend to get more posts.</p>
<p>I want these to be retrived from the db from newest to oldest, but the model.save() method of mongoose always inserts a new model at the end of the collection.</p>
<p>So when a new post created the backend does this right now:</p>
<pre><code>const post = new Post({
    text: req.body.text,
    author: {
        userid: user._id,
        name: user.username,
        picPath: user.picPath
    },
    images: images
});
post.save(function (err) {
    let status = true;
    let message = &quot;Post mentve.&quot;
    if (err) { status = false; message = err; console.log(err) }
    return res.send({ status: status, msg: message });
})
</code></pre>
<p>This way, a new post pushed to the collection. And not unshifted.</p>
<p>When the client wants new posts the backend does this:</p>
<pre><code>    app.get('/dynamicPostLoad/:offset/:limit', async (req, res) =&gt; {
        let offset  = req.params.offset;
        let limit   = req.params.limit;
        let response = {
            status: true,
            posts : [],
            message: &quot;Fetched&quot;
        };
        await Post.find({}).skip(offset).limit(limit).then(products =&gt; {
            response.posts = products;
        }).catch((err)=&gt; {
            response.status = false;
            response.message = err;
        });
        return res.send(response);
    });
</code></pre>
<p>So the mongoose will fetch from oldest to newst since all the new is inserted at the end of the collection.</p>
<p>That way, the user will see the oldest post first and as he scrolls, sees the oldest and oldest posts.</p>
<p><strong>I was thinking on three ways.</strong></p>
<p>Either the <code>Post.find({})</code> method should crawl the documents from the end of the collection or the <code>Post.save()</code> method should unshift the document instead of push or i could find all the posts in the collection and reverse them. ( the last one would be painfully slow )</p>
<p><em>EDIT: Every post contains a creation date, so it could be sorted.</em></p>
<p>How can i achive this?</p>

